/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `ACCESOS` BEFORE INSERT ON `accesos_historico` FOR EACH ROW
-- Edit trigger body code below this line. Do not edit lines above this one
BEGIN
	
	DECLARE EXISTE INT;

	SELECT COUNT(*) INTO EXISTE FROM ACCESOS WHERE ID_USUARIO = NEW.ID_USUARIO;

	IF (EXISTE = 1) THEN
		UPDATE ACCESOS
		SET FECHA = DATE(NOW()),
			HORA = TIME(NOW()),
			IP = NEW.IP,
			CONECT = 1,
			LONGITUD = NEW.LONGITUD,
			LATITUD = NEW.LATITUD
		WHERE ID_USUARIO = NEW.ID_USUARIO;
	ELSE
		INSERT INTO ACCESOS (ID_USUARIO, IP, HOST, FECHA, HORA, CONECT, LONGITUD, LATITUD)
		VALUES (NEW.ID_USUARIO, NEW.IP, NEW.HOST , DATE(NOW()), TIME(NOW()), 1, NEW.LONGITUD, NEW.LATITUD);
	END IF;
END */;;
