/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `plazas_BUPD` BEFORE UPDATE ON `plazas` FOR EACH ROW
-- Edit trigger body code below this line. Do not edit lines above this one
BEGIN
	DECLARE VALOR_PARKING DOUBLE;

	SET NEW.FECHA = DATE(NOW());
	IF (NEW.ESTADO = 1) THEN
		SET NEW.HORA_INGRESO = TIME(NOW());
		SET NEW.HORA_SALIDA = NULL;
		SET NEW.HORA_TOTAL = NULL;
		SET NEW.VALOR = NULL;
		SET NEW.ESTADO_HORA = 1;
	ELSE		
		SET NEW.HORA_SALIDA = TIME(NOW());
		SET NEW.HORA_TOTAL = TIMEDIFF(NEW.HORA_SALIDA, NEW.HORA_INGRESO);
		SET NEW.ESTADO_HORA = 2;

		SELECT VALOR INTO VALOR_PARKING FROM PARKING WHERE ID_PARKING = NEW.ID_PARKING;
		SET NEW.VALOR = ROUND((CONCAT(MINUTE(NEW.HORA_TOTAL), '.', SECOND(NEW.HORA_TOTAL)) * VALOR_PARKING), 2);
	END IF;
END */;;
DELIMITER ;
