-- Edit trigger body code below this line. Do not edit lines above this one
BEGIN
	IF (NEW.ESTADO_HORA = 2) THEN
		INSERT INTO PLAZAS_HISTORICO (ID_PARKING, ID_PLAZA, PLACA, FECHA, HORA_INGRESO, HORA_SALIDA, HORA_TOTAL, VALOR)
		VALUES (NEW.ID_PARKING, NEW.ID_PLAZA, NEW.PLACA, NEW.FECHA, NEW.HORA_INGRESO, NEW.HORA_SALIDA, NEW.HORA_TOTAL, NEW.VALOR);
	END IF;
END */;;
